CREATE TABLE mytable(
   id                        INTEGER  NOT NULL PRIMARY KEY 
  ,brand_name                VARCHAR(9) NOT NULL
  ,model                     VARCHAR(50) NOT NULL
  ,price                     INTEGER  NOT NULL
  ,avg_rating                NUMERIC(5,3) NOT NULL
  ,_5G_or_not                BIT  NOT NULL
  ,processor_brand           VARCHAR(17) NOT NULL
  ,num_cores                 INTEGER  NOT NULL
  ,processor_speed           NUMERIC(5,3) NOT NULL
  ,battery_capacity          INTEGER  NOT NULL
  ,fast_charging_available   BIT  NOT NULL
  ,fast_charging             VARCHAR(6) NOT NULL
  ,ram_capacity              INTEGER  NOT NULL
  ,internal_memory           INTEGER  NOT NULL
  ,screen_size               NUMERIC(5,3) NOT NULL
  ,refresh_rate              INTEGER  NOT NULL
  ,num_rear_cameras          INTEGER  NOT NULL
  ,os                        VARCHAR(7) NOT NULL
  ,primary_camera_rear       NUMERIC(6,2) NOT NULL
  ,primary_camera_front      INTEGER  NOT NULL
  ,extended_memory_available BIT  NOT NULL
  ,resolution_height         INTEGER  NOT NULL
  ,resolution_width          INTEGER  NOT NULL
  ,price_to_pln              INTEGER  NOT NULL
);
